CREATE DATABASE zxjy;
use zxjy;
CREATE TABLE IF NOT EXISTS zxjy_result
(
    customer_nums     int         NULL COMMENT '意向客户总和',
    clue_nums         int         NULL COMMENT '有效线索总和',
    time_type         varchar(50) NULL COMMENT '时间分组,`null` 表示全部，all表示年和月，其它具体化',
    yearinfo          varchar(50) NULL COMMENT '年',
    monthinfo         varchar(50) NULL COMMENT '月',
    origin_type_state varchar(50) NULL COMMENT '数据来源:0.线下；1.线上',
    clue_state_stat   varchar(50) NULL COMMENT '新老客户：0.老客户；1.新客户',
    group_type        varchar(50) NULL COMMENT '其他',
    area              varchar(50) NULL COMMENT '所在区域',
    itcast_subject_id int         NULL COMMENT '学科Id',
    subject_name      varchar(50) NULL COMMENT '学科名称',
    itcast_school_id  int         NULL COMMENT '校区Id',
    school_name       varchar(50) NULL COMMENT '校区名称',
    tdepart_id        int         NULL COMMENT '直属部门id',
    tdepart_name      varchar(50) NULL COMMENT '部门名称',
    dt                varchar(50) NULL
)
    ENGINE=InnoDB DEFAULT CHARSET=utf8;

